import React, { useState } from 'react';
import axios from 'axios';
import '../Main/dashboard.css'; 
import './appointment.css';

function Appointment() {
  const [formState, setFormState] = useState({
    fullName: "",
    telephone: "",
    address: "",
    description: "",
    carModel: "",
    carBrand: "",
    carYear: "",
    carType: "",
    carCapacity: "",
    carHP: "",
    carKW: "",
    carWeight: "",
    carCIV: "",
    carVIN: "",
    carTraction: "",
    carRegiNr: ""
  });
  
  const handleChange = (event) => {
    setFormState({
      ...formState,
      [event.target.name]: event.target.value
    });
  };
  
  const handleSubmit = async (event) => {
    event.preventDefault();
    const appointment = { 
      fullName: formState.fullName, 
      telephone: formState.telephone, 
      address: formState.address, 
      description: formState.description, 
      carModel: formState.carModel,
      carBrand: formState.carBrand,
      carYear: formState.carYear,
      carType: formState.carType,
      carCapacity: formState.carCapacity,
      carHP: formState.carHP,
      carKW: formState.carKW,
      carWeight: formState.carWeight,
      carCIV: formState.carCIV,
      carVIN: formState.carVIN,
      carTraction: formState.carTraction,
      carRegiNr: formState.carRegiNr
    };
    await axios.post('/api/appointments', appointment);
  };
  
  return (
    <div className="bigbox">
      <h1>APPOINTMENT</h1>
      <p> | Need repair? |</p>
      <div className="info_data">ADD YOUR INFORMATIONS</div>
      <div className="appointment">
        <div className="appointment_box">
          <form onSubmit={handleSubmit}>
            <input className="text_input" type="text" name="fullName" value={formState.fullName} onChange={handleChange} placeholder="Full Name" required />
            <input className="text_input" type="tel" name="telephone" value={formState.telephone} onChange={handleChange} placeholder="Telephone" required />
            <input className="text_input" type="text" name="address" value={formState.address} onChange={handleChange} placeholder="Address" required />
            <input className="text_input" name="description" value={formState.description} onChange={handleChange} placeholder="Description of problem" required />
          </form>
        </div>
        <div className="appointment_box_2">
          <form onSubmit={handleSubmit}>
            <input className="text_input" type="text" name="carModel" value={formState.carModel} onChange={handleChange} placeholder="Car Model" required />
            <input className="text_input" type="text" name="carBrand" value={formState.carBrand} onChange={handleChange} placeholder="Car Brand" required />
            <input className="text_input" type="text" name="carYear" value={formState.carYear} onChange={handleChange} placeholder="Car Year" required />
            <input className="text_input" type="text" name="carType" value={formState.carType} onChange={handleChange} placeholder="Car Type" required />
            <input className="text_input" type="text" name="carCapacity" value={formState.carCapacity} onChange={handleChange} placeholder="Car Capacity" required />
            <input className="text_input" type="text" name="carHP" value={formState.carHP} onChange={handleChange} placeholder="Car HP" required />
            <input className="text_input" type="text" name="carKW" value={formState.carKW} onChange={handleChange} placeholder="Car KW" required />
            <input className="text_input" type="text" name="carWeight" value={formState.carWeight} onChange={handleChange} placeholder="Car Weight" required />
            <input className="text_input" type="text" name="carCIV" value={formState.carCIV} onChange={handleChange} placeholder="Car CIV" required />
            <input className="text_input" type="text" name="carVIN" value={formState.carVIN} onChange={handleChange} placeholder="Car VIN" required />
            <input className="text_input" type="text" name="carTraction" value={formState.carTraction} onChange={handleChange} placeholder="Car Traction" required />
            <input className="text_input" type="text" name="carRegiNr" value={formState.carRegiNr} onChange={handleChange} placeholder="Car RegiNr" required />
          </form>
        </div>
        <button className="submit_2" type="submit">Submit</button>
      </div>     
    </div>
  );
}
export default Appointment;
